import React from 'react';
import styles from './OWASP.module.css';

const OWASPTop10 = () => {
const vulnerabilities = [
  {
    id: 1,
    name: "Broken Access Control",
    description: "Restrictions on what authenticated users are allowed to do are not properly enforced...",
    link: "./broken-access-control",
    image: "/images/owasp/broken-access-control.jpg"
  },
  {
    id: 2,
    name: "Cryptographic Failures",
    description: "Failures related to cryptography often lead to exposure of sensitive data...",
    link: "./cryptographic-failures",
    image: "/images/owasp/cryptographic-failures.jpg"
  },
  {
    id: 3,
    name: "Injection",
    description: "Untrusted data sent to an interpreter can lead to data corruption or unauthorized access...",
    link: "./injection",
    image: "/images/owasp/injection.jpg"
  },
  {
    id: 4,
    name: "Insecure Design",
    description: "Missing or ineffective control design fails to prevent security flaws...",
    link: "./insecure-design",
    image: "/images/owasp/insecure-design.jpg"
  },
  {
    id: 5,
    name: "Security Misconfiguration",
    description: "Insecure configurations in any part of the application stack...",
    link: "./security-misconfiguration",
    image: "/images/owasp/security-misconfiguration.jpg"
  },
  {
    id: 6,
    name: "Vulnerable Components",
    description: "Using components with known vulnerabilities can compromise applications...",
    link: "./vulnerable-components",
    image: "/images/owasp/vulnerable-components.jpg"
  },
  {
    id: 7,
    name: "Authentication Failures",
    description: "Broken authentication mechanisms allow brute force or session hijacking...",
    link: "./authentication-failures",
    image: "/images/owasp/authentication-failures.jpg"
  },
  {
    id: 8,
    name: "Software & Data Integrity",
    description: "Failures related to unverified updates or CI/CD pipelines...",
    link: "./software-data-integrity",
    image: "/images/owasp/software-data-integrity.jpg"
  },
  {
    id: 9,
    name: "Security Logging Failures",
    description: "Failures in logging or monitoring prevent proper threat detection...",
    link: "./security-logging-failures",
    image: "/images/owasp/security-logging-failures.jpg"
  },
  {
    id: 10,
    name: "Server-Side Request Forgery",
    description: "Applications fetch remote resources without validating URLs...",
    link: "./server-side-request-forgery",
    image: "/images/owasp/server-side-request-forgery.jpg"
  }
];


  const VulnerabilityCard = ({ vulnerability }) => {
    return (
      <div className={styles.card}>
        <div 
          className={styles.cardImage}
          style={{ 
            backgroundColor: vulnerability.color,
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: 'white',
            fontSize: '3rem'
          }}
        >
          <div style={{ textAlign: 'center' }}>
            <div style={{ fontSize: '4rem', marginBottom: '10px' }}>
              {vulnerability.icon}
            </div>
            <div style={{ 
              fontSize: '1.5rem', 
              fontWeight: 'bold',
              background: 'rgba(0,0,0,0.3)',
              padding: '5px 10px',
              borderRadius: '5px'
            }}>
              #{vulnerability.id}
            </div>
          </div>
        </div>

        <div className={styles.cardContent}>
          <h3 className={`${styles.cardTitle} ${styles.lineClamp2}`}>
            {vulnerability.name}
          </h3>

          <p className={`${styles.cardDescription} ${styles.lineClamp3}`}>
            {vulnerability.description}
          </p>

          <a
            href={vulnerability.link}
            target="_blank"
            rel="noopener noreferrer"
            className={styles.cardLink}
          >
            Learn More
            <svg className={styles.linkIcon} fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2}
                d="M10 6H6a2 2 0 00-2 2v10a2 2 0 002 2h10a2 2 0 002-2v-4M14 4h6m0 0v6m0-6L10 14" />
            </svg>
          </a>
        </div>
      </div>
    );
  };

  return (
    <div className={styles.container}>
      <div className={styles.wrapper}>
        <div className={styles.header}>
          <h1 className={styles.title}>
            OWASP Top 10 Vulnerabilities
          </h1>
          <p className={styles.subtitle}>
            The most critical web application security risks identified by the Open Web Application Security Project
          </p>
        </div>

        {/* First Row - 5 cards */}
        <div className={styles.row}>
          {vulnerabilities.slice(0, 5).map((vuln) => (
            <VulnerabilityCard key={vuln.id} vulnerability={vuln} />
          ))}
        </div>

        {/* Second Row - 5 cards */}
        <div className={styles.row}>
          {vulnerabilities.slice(5, 10).map((vuln) => (
            <VulnerabilityCard key={vuln.id} vulnerability={vuln} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default OWASPTop10;
